import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import './index.css';

function SideBar() {
  const location = useLocation();
  return (
    <div className='sidebar'>
      <h2>Manage</h2>
      <div className='sidebarItem'>
        <div className='scrbar' />
        <div
          className={`${
            location.pathname === '/page2' ? { marginTop: 50 } : ''
          } scrbarFocus`}
        />
        <div className='barItem'>
          <Link to='/'>
            <h4>Sessions</h4>
          </Link>
          <h4 className='normal'>Threshold Sets</h4>
          <Link to='/page2'>
            <h4 className='normal'>Questionnaire</h4>
          </Link>
          <Link to='/page2'>
            <h4 className='normal'>AI Model</h4>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default SideBar;
